    nbcc=zeros(1,3);
    nblow=zeros(1,3);
    dbcc=zeros(1,3);
    dblow=zeros(1,3);

    pop_size=60;           % Population size
    gen_max=60;            % MAx number of generations - stopping criteria
      
    CFA_PF_REF=1-DR(i,100:104);
    WEIGHT_PF_REF=DR(i,105:109).*wac;
    
    MIGDconv=0;
    [extrOptPFArea,extrOptPFCS,extrOptPFVol,extrOptPFNb,extrOptPFDb,PF_CS,...
    PF_VOL,newPop,feasibleSol,genCFA,genVOL,IGDt,IGDv]=NSGAIISSBeamsRebarSimple(b,h,...
    span,brec,hrec,hagg,pmin,pmax,rebarAvailable([2:10]',:),fcu,load_conditions,...
    fy,wac,cutxLoc,dbcc,nbcc,dblow,nblow,WEIGHT_PF_REF,CFA_PF_REF,Wfac,pccb,...
    MIGDconv,pop_size,gen_max);

